import React from 'react';
import './Contact.css';

class Contact extends React.Component {
    constructor(props) {
      super(props);

    }



    render() {
        if (this.props.buttonHide === false) {
          return (
              <div className="contactButton">
                  Contact Us
              </div>
          )
          } else {
          return null
          }
      }
}

export default Contact;
